"use strict";(self.webpackChunkdocs=self.webpackChunkdocs||[]).push([[132],{6678:e=>{e.exports=JSON.parse('{"functions":[{"name":"tween","desc":"Asynchronously performs a tween on the given object. Tween parameters are\\nidentical to `TweenService:Create()`.\\n\\n```lua\\nAnimNation.tween(part, TweenInfo.new(2, Enum.EasingStyle.Quad, Enum.EasingDirection.Out), {\\n\\tPosition = Vector3.new(10, 20, 30),\\n\\tRotation = Vector3.new(45, 90, 0),\\n}):Await()\\n```","params":[{"name":"object","desc":"The object or objects to apply the tween to.","lua_type":"Instance | { Instance }"},{"name":"tweenInfo","desc":"The tween information or a table of tween parameters.","lua_type":"TweenInfo | TweenInfoTable"},{"name":"properties","desc":"A dictionary of properties to tween to.","lua_type":"{ [string]: any }"}],"returns":[{"desc":"An AnimChain representing the tween.","lua_type":"AnimChain"}],"function_type":"static","source":{"line":545,"path":"AnimNation/init.luau"}},{"name":"tweenFromAlpha","desc":"Asynchronously performs a tween on the given object, starting from the\\nspecified alpha percentage. Otherwise identical to `AnimNation.tween`.\\n\\n```lua\\nAnimNation.tweenFromAlpha(part, TweenInfo.new(2, Enum.EasingStyle.Quad, Enum.EasingDirection.Out), {\\n\\tPosition = Vector3.new(10, 20, 30),\\n\\tRotation = Vector3.new(45, 90, 0),\\n}, 0.5)\\n```","params":[{"name":"objects","desc":"The object or objects to apply the tween to.","lua_type":"Instance | { Instance }"},{"name":"tweenInfo","desc":"The tween information or a table of tween parameters.","lua_type":"TweenInfo | TweenInfoTable"},{"name":"properties","desc":"A dictionary of properties to tween to.","lua_type":"{ [string]: any }"},{"name":"alpha","desc":"The alpha percentage to start from (0-1).","lua_type":"number"},{"name":"yield","desc":"Whether to yield until the tween is complete.","lua_type":"boolean?"}],"returns":[],"function_type":"static","source":{"line":633,"path":"AnimNation/init.luau"}},{"name":"getTweenFromInstance","desc":"Returns the last tween played on the given object, or nil if none exists.","params":[{"name":"object","desc":"The object to get the tween from.","lua_type":"Instance"}],"returns":[{"desc":"The last tween played on the object.","lua_type":"Tween?"}],"function_type":"static","source":{"line":770,"path":"AnimNation/init.luau"}},{"name":"lerp","desc":"Instantly set the given object\'s properties to a lerped value between its\\ncurrent state and the given properties. Functions like `.tweenFromAlpha()`,\\nexcept that it doesn\'t continue to play the tween. Naturally, the time value\\nused in the provided TweenInfo or table has no effect on this function.\\n\\nCurrently supports number, Vector2, Vector3, CFrame, Color3, UDim2, UDim and\\nany other type that supports scalar\\tmultiplication/addition.\\n\\n```lua\\nAnimNation.lerp(part, TweenInfo.new(1, Enum.EasingStyle.Quad, Enum.EasingDirection.Out), {\\n\\tPosition = Vector3.new(10, 20, 30),\\n\\tRotation = Vector3.new(45, 90, 0),\\n}, 0.5)\\n```","params":[{"name":"object","desc":"The object or objects to apply the lerp to.","lua_type":"Instance | { Instance }"},{"name":"tweenInfo","desc":"The tween information or a table of tween parameters.","lua_type":"TweenInfo | TweenInfoTable"},{"name":"properties","desc":"A dictionary of properties to lerp to.","lua_type":"{ [string]: any }"},{"name":"alpha","desc":"The alpha percentage to lerp to (0-1).","lua_type":"number"}],"returns":[],"function_type":"static","source":{"line":795,"path":"AnimNation/init.luau"}},{"name":"impulse","desc":"Asynchronously performs a spring impulse on the given object.\\n\\n```lua\\nAnimNation.impulse(part, { s = 15, d = 0.7 }, {\\n\\tPosition = Vector3.new(10, 20, 30),\\n\\tRotation = Vector3.new(45, 90, 0),\\n}):Await()\\n```","params":[{"name":"object","desc":"The object or objects to apply the impulse to.","lua_type":"Instance | { Instance }"},{"name":"springInfo","desc":"A table of spring properties such as `{s = 10, d = 0.5}`.","lua_type":"SpringInfo"},{"name":"properties","desc":"A dictionary of properties to apply impulses to.","lua_type":"{ [string]: any }"}],"returns":[{"desc":"An AnimChain representing the spring animations.","lua_type":"AnimChain"}],"function_type":"static","source":{"line":851,"path":"AnimNation/init.luau"}},{"name":"target","desc":"Asynchronously uses a spring to transition the given object\'s properties to\\nthe specified values.\\n\\n```lua\\nAnimNation.target(part, { s = 15, d = 0.7 }, {\\n\\tPosition = Vector3.new(10, 20, 30),\\n\\tRotation = Vector3.new(45, 90, 0),\\n}):Await()\\n```","params":[{"name":"object","desc":"The object or objects to apply the target to.","lua_type":"Instance | { Instance }"},{"name":"springInfo","desc":"A table of spring properties such as `{s = 10, d = 0.5}`.","lua_type":"SpringInfo"},{"name":"properties","desc":"A dictionary of properties to target.","lua_type":"{ [string]: any }"}],"returns":[{"desc":"An AnimChain representing the spring animations.","lua_type":"AnimChain"}],"function_type":"static","source":{"line":937,"path":"AnimNation/init.luau"}},{"name":"bind","desc":"Binds a callback function to the given springs\' position and velocity. Can be\\nused to create more complex and constant interactions with spring values\\nthan just a quick impulse or target.\\n\\n```lua\\nAnimNation.bind({ spring1, spring2 }, \\"MyBind\\", function(positions, velocities)\\n\\tprint(\\"Spring 1 Position:\\", positions[1], \\"Velocity:\\", velocities[1])\\n\\tprint(\\"Spring 2 Position:\\", positions[2], \\"Velocity:\\", velocities[2])\\nend)\\n```","params":[{"name":"springs","desc":"A table of springs to bind to.","lua_type":"{ Spring }"},{"name":"label","desc":"A unique label to identify this bind.","lua_type":"string"},{"name":"callback","desc":"The function to call on each update.","lua_type":"(positions: { Springable }, velocities: { Springable }) -> ()"}],"returns":[],"function_type":"static","source":{"line":988,"path":"AnimNation/init.luau"}},{"name":"unbind","desc":"Unbinds the callback associated with the specified label from updates.","params":[{"name":"label","desc":"","lua_type":"string"}],"returns":[],"function_type":"static","source":{"line":1000,"path":"AnimNation/init.luau"}},{"name":"createSpring","desc":"Creates a new spring with the given properties.\\n\\n```lua\\nlocal mySpring = AnimNation.createSpring({ s = 10, d = 0.5 }, \\"MySpring\\")\\n```","params":[{"name":"springInfo","desc":"A table of spring properties such as `{s = 10, d = 0.5}`.","lua_type":"SpringInfo"},{"name":"name","desc":"An optional name for lookup with `AnimNation.getSpring()`.","lua_type":"string?"}],"returns":[{"desc":"The newly created spring.","lua_type":"Spring"}],"function_type":"static","source":{"line":1015,"path":"AnimNation/init.luau"}},{"name":"getSpring","desc":"Returns the spring with the given name.If none exists, it will return `nil`\\nwith a warning, or an error depending on the set `ERROR_POLICY`.\\n\\n```lua\\nlocal mySpring = AnimNation.getSpring(\\"MySpring\\")\\n```","params":[{"name":"name","desc":"The name of the spring to retrieve.","lua_type":"string"}],"returns":[{"desc":"The spring with the given name.","lua_type":"Spring"}],"function_type":"static","source":{"line":1035,"path":"AnimNation/init.luau"}},{"name":"createSpline","desc":"Creates a new spline from the given control points. This should be a table\\nof CFrame values with at least 4 entries. Optionally allows you to provide a\\nname for lookup with `AnimNation.getSpline()`.\\n\\n```lua\\nlocal mySpline = AnimNation.createSpline({\\n\\tCFrame.new(0, 0, 0),\\n\\tCFrame.new(5, 10, 0),\\n\\tCFrame.new(10, 0, 0),\\n\\tCFrame.new(15, 10, 0),\\n}, \\"MySpline\\")\\n```","params":[{"name":"controlPoints","desc":"A table of CFrame control points with at least 4 entries.","lua_type":"{ CFrame }"},{"name":"name","desc":"An optional name for lookup with `AnimNation.getSpline()`.","lua_type":"string?"}],"returns":[{"desc":"The newly created spline.","lua_type":"Spline"}],"function_type":"static","source":{"line":1061,"path":"AnimNation/init.luau"}},{"name":"getSpline","desc":"Returns the spline with the given name. If none exists, it will return `nil`\\nwith a warning, or an error depending on the set `ERROR_POLICY`.\\n\\n```lua\\nlocal mySpline = AnimNation.getSpline(\\"MySpline\\")\\n```","params":[{"name":"name","desc":"The name of the spline to retrieve.","lua_type":"string"}],"returns":[{"desc":"The spline with the given name.","lua_type":"Spline"}],"function_type":"static","source":{"line":1081,"path":"AnimNation/init.luau"}},{"name":"slerpTweenFromAlpha","desc":"Asynchronously performs tween-based spherical interpolation on the given\\nobject, starting from the specified `alpha` percentage.\\n\\nParameters are similar to `AnimNation.tweenFromAlpha()`, with the addition of\\n`alignment` which determines whether the object being tweened is aligned to\\nthe track orientation or the nodes\' orientations. A spline argument is also\\nrequired, which can be supplied as previously constructed Spline object or an\\narray of points to create a new one from.\\n\\nCurrently supports number, Vector2, Vector3, CFrame, Color3, UDim2, UDim and\\nany other type that supports scalar multiplication/addition.\\n\\n```lua\\nAnimNation.slerpTweenFromAlpha(part, {\\n\\tt = 2,\\n\\ts = Enum.EasingStyle.Quad,\\n\\td = Enum.EasingDirection.Out,\\n}, {\\n\\tCFrame = AnimNation.createSpline({\\n\\t\\tCFrame.new(0, 0, 0),\\n\\t\\tCFrame.new(5, 10, 0),\\n\\t\\tCFrame.new(10, 0, 0),\\n\\t\\tCFrame.new(15, 10, 0),\\n\\t}),\\n}, \\"Track\\", 0.25, true)\\n```","params":[{"name":"object","desc":"The object to perform the slerp tween on.","lua_type":"Instance"},{"name":"tweenInfo","desc":"A TweenInfo or table describing the tween parameters.","lua_type":"TweenInfo | TweenInfoTable"},{"name":"splineInfo","desc":"A Spline object or table of CFrame control points.","lua_type":"Spline | { CFrame }"},{"name":"alignment","desc":"Optional; whether to align to the track or nodes. Defaults to \\"Nodes\\".","lua_type":"(\\"Track\\" | \\"Nodes\\")?"},{"name":"alpha","desc":"Optional; the starting alpha percentage (0-1). Defaults to 0.","lua_type":"number?"},{"name":"yield","desc":"Optional; whether to yield until the tween is complete. Defaults to false.","lua_type":"boolean?"}],"returns":[],"function_type":"static","source":{"line":1124,"path":"AnimNation/init.luau"}}],"properties":[],"types":[{"name":"SpringInfo","desc":"A dictionary of spring properties such as {s = 10, d = 0.5}. Can be\\nconstructed using any keys that you could use to create a Spring object.\\n\\nPossible keys:\\n```\\nInitial = Initial | i\\nSpeed = Speed | s\\nDamper = Damper | d\\nTarget = Target | t\\nVelocity = Velocity | v\\nPosition = Position | Value | p\\nClock = Clock\\n```","fields":[{"name":"Position","lua_type":"Springable?","desc":""},{"name":"Velocity","lua_type":"number?","desc":""},{"name":"Target","lua_type":"Springable?","desc":""},{"name":"Damper","lua_type":"number?","desc":""},{"name":"Speed","lua_type":"number?","desc":""},{"name":"Initial","lua_type":"Springable?","desc":""},{"name":"Clock","lua_type":"(() -> number)?","desc":""}],"source":{"line":112,"path":"AnimNation/init.luau"}},{"name":"TweenInfoTable","desc":"TweenInfo can be passed to the tweening functions as either a TweenInfo\\nobject or a dictionary of the desired parameters. Keys are either the\\nTweenInfo parameter name or shortened versions:\\n```\\nTime = Time | t\\nEasingStyle = EasingStyle | Style | s\\nEasingDirection = EasingDirection | Direction | d\\nRepeatCount = RepeatCount | Repeat | rc\\nReverses = Reverses | Reverse | r\\nDelayTime = DelayTime | Delay | dt\\n```","fields":[{"name":"Time","lua_type":"number?","desc":""},{"name":"EasingStyle","lua_type":"Enum.EasingStyle?","desc":""},{"name":"EasingDirection","lua_type":"Enum.EasingDirection?","desc":""},{"name":"RepeatCount","lua_type":"number?","desc":""},{"name":"Reverses","lua_type":"boolean?","desc":""},{"name":"DelayTime","lua_type":"number?","desc":""}],"source":{"line":157,"path":"AnimNation/init.luau"}}],"name":"AnimNation","desc":"An animation library that enables quick one-shot style animations for most\\ninstances and properties.\\n\\n# Tweens\\n\\nAnimNation tweens support all properties that are supported by TweenService,\\nas well as tweening Models by CFrame/Scale and tweening\\nNumberSequence/ColorSequence values\\t(given that the target sequence has the\\nsame number of keypoints).\\n\\n# Springs\\n\\nAnimNation springs support the following types: number, Vector2, Vector3,\\nUDim, UDim2, CFrame, and Color3. These are natively supported by the\\nprovided Spring class as well.\\n\\n# Splines\\n\\nAnimNation splines are used in animation for interpolating between a series\\nof points in a smoothed curving fashion. They currently only support CFrame\\ntypes and do not yet return AnimChains.","source":{"line":38,"path":"AnimNation/init.luau"}}')}}]);